impl Solution {
    pub fn is_fascinating(n: i32) -> bool {
        // Concatenate n, 2 * n, and 3 * n as a String
        let concatenated = format!("{}{}{}", n, n * 2, n * 3);

        // Create a vector to count the frequency of each digit
        let mut counts = vec![0; 10]; // 0-9

        // Iterate over each character in the concatenated string
        for ch in concatenated.chars() {
            // Convert character to its numeric value
            if let Some(digit) = ch.to_digit(10) {
                counts[digit as usize] += 1;
            }
        }

        // Check if each digit from 1 to 9 appears exactly once and 0 does not appear
        counts[0] == 0 && (1..=9).all(|i| counts[i] == 1)
    }
}
